meout(function () {\n    /**\n     * @variable cb_obj `fig_ohlc.x_range`.\n     * @variable source `ColumnDataSource`\n     * @variable ohlc_range `fig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"2298608","type":"CustomJS"},{"attributes":{},"id":"2298468","type":"LinearScale"},{"attributes":{},"id":"2298269","type":"LinearScale"},{"attributes":{"line_alpha":0.2,"line_color":"#1f77b4","line_width":1.5,"x":{"field":"index"},"y":{"field":"equity"}},"id":"2298307","type":"Line"},{"attributes":{"source":{"id":"2298257"}},"id":"2298309","type":"CDSView"},{"attributes":{"bottom":{"field":"Close"},"fill_color":{"field":"inc","transform":{"id":"2298259"}},"top":{"field":"Open"},"width":{"value":0.8},"x":{"field":"index"}},"id":"2298526","type":"VBar"},{"attributes":{},"id":"2298332","type":"Selection"},{"attributes":{},"id":"2298594","type":"BasicTickFormatter"},{"attributes":{},"id":"2298548","type":"UnionRenderers"},{"attributes":{"source":{"id":"2298257"}},"id":"2298500","type":"CDSView"},{"attributes":{},"id":"2298229","type":"LinearScale"},{"attributes":{},"id":"2298328","type":"Selection"},{"attributes":{"fill_color":"#ffffea","line_color":"#ffcb66","x":{"field":"index"},"y":{"field":"equity_dd"}},"id":"2298299","type":"Patch"},{"attributes":{"coordinates":null,"group":null},"id":"2298641","type":"Title"},{"attributes":{},"id":"2298234","type":"BasicTicker"},{"attributes":{},"id":"2298598","type":"AllLa
